import React, { useState, useEffect } from 'react';
import { 
    Table, 
    TableBody, 
    TableCell, 
    TableContainer, 
    TableHead, 
    TableRow, 
    Paper, 
    Container, 
    Typography,
    Button,
    Box,
    Fab
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import { getAllClubs, deleteClub } from '../services/clubService';
import { useNavigate } from 'react-router-dom';

const ClubList = () => {
    const navigate = useNavigate();
    const [clubs, setClubs] = useState([]);

    const fetchClubs = async () => {
        try {
            const response = await getAllClubs();
            setClubs(response.data);
        } catch (error) {
            console.error('Error fetching clubs:', error);
            alert('Error loading clubs. Please try again.');
        }
    };

    useEffect(() => {
        fetchClubs();
    }, []);

    const handleDelete = async (id) => {
        if (window.confirm('Are you sure you want to delete this club?')) {
            try {
                await deleteClub(id);
                fetchClubs();
                alert('Club deleted successfully!');
            } catch (error) {
                console.error('Error deleting club:', error);
                alert('Error deleting club. Please try again.');
            }
        }
    };

    return (
        <Container maxWidth="lg">
            <Box sx={{ mt: 4, mb: 4, position: 'relative' }}>
                <Typography variant="h4" component="h1" gutterBottom>
                    Clubs
                </Typography>
                <Fab 
                    color="primary" 
                    aria-label="add"
                    onClick={() => navigate('/clubs/new')}
                    sx={{ position: 'absolute', top: 0, right: 0 }}
                >
                    <AddIcon />
                </Fab>
                <TableContainer component={Paper}>
                    <Table>
                        <TableHead>
                            <TableRow>
                                <TableCell>ID</TableCell>
                                <TableCell>Name</TableCell>
                                <TableCell>Description</TableCell>
                                <TableCell>Email</TableCell>
                                <TableCell>Actions</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {clubs.map((club) => (
                                <TableRow key={club.clubId}>
                                    <TableCell>{club.clubId}</TableCell>
                                    <TableCell>{club.clubName}</TableCell>
                                    <TableCell>{club.clubDescription}</TableCell>
                                    <TableCell>{club.clubEmail}</TableCell>
                                    <TableCell>
                                        <Button
                                            variant="contained"
                                            color="primary"
                                            size="small"
                                            onClick={() => navigate(`/clubs/edit/${club.clubId}`)}
                                            sx={{ mr: 1 }}
                                        >
                                            Edit
                                        </Button>
                                        <Button
                                            variant="contained"
                                            color="error"
                                            size="small"
                                            onClick={() => handleDelete(club.clubId)}
                                        >
                                            Delete
                                        </Button>
                                    </TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            </Box>
        </Container>
    );
};

export default ClubList;
